//开发所使用的助手函数
const helper = {
    isJSON(str) {
        if (typeof str == 'string') {
            try {
                var obj = JSON.parse(str);
                if (str.indexOf('{') > -1) {
                    return obj;
                } else {
                    return false;
                }

            } catch (e) {
                return false;
            }
        }
        return false;
    },

    compatibility(version) {
        if (version && (AirocovMap.VERSION.split(".")[0] === version.split(".")[0])) {
            return true;
        } else {
            return false;
        }
    },
    //判断浏览器是否兼容
    webGL: function () {
        try {
            var canvas = document.createElement('canvas');
            return !!(window.WebGLRenderingContext && (canvas.getContext('webgl') || canvas.getContext('experimental-webgl')));
        } catch (e) {
            throw new Error("The browser version is not compatible with WEBGL");
        }
    },
    mapLogo() {
        var img = new Image();
        img.scr = "data:image/png;base64,";
        return img;
    },

    isEmpty(value){
        if (value) {
            if (value.length <= 0 || JSON.stringify(value) == "{}") {
                return true;
            }
            return false;
        } else {
            if (value === 0) {
                return false;
            }
            return true;
        }
    },

    isType(type){
        return function (obj) {
            return {}.toString.call(obj) == "[object " + type + "]"
        }
    }

};

// export default helper;

module.exports = helper;